script: |
  super -f text -I q6168.spq | sort > q6168.out

inputs:
  - name: q6168.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + 11 + + 2 NOT BETWEEN ( + - col0 * col0 + + + col2 + + col0 ) AND - ( + col0 ) / col2;
  - name: tab2

outputs:
  - name: q6168.out
    data: |
      46	51	23
      64	77	40
      75	67	58
